script: |
  super -f text -I q2324.spq | sort > q2324.out

inputs:
  - name: q2324.spq
    data: |
      SELECT col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT col2 + - 55 * - col0 NOT BETWEEN - - ( + col0 ) * col2 * 60 - - col2 * col2 AND + 60;
  - name: tab1

outputs:
  - name: q2324.out
    data: |
